import React, { Component } from 'react'

export default class extends Component {
  constructor(props) {
    super(props)
  }

  // Ensure that an API call is successful.
  testAPIService() {
    fetch('/test')
    .then(res => console.log(res))
    .catch(rej => console.log(rej))
  }

  componentDidMount() {
    this.testAPIService()
  }

  render() {
    return (
      <div className='center-container'>
        <Ribbon />
        <LogoSplash />
      </div>
    )
  }
}
